import './Title.css';
import Media from 'react-media';
import { FcDocument } from 'react-icons/fc';
import { useNavigate, Link } from 'react-router-dom';
import IconPrint from './Print';

// Return Title Component
export default function ReturnTitle() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};
export const ScreenLarge = () => (
 <div className='wrp-actif-title'>
  <ViewText />
  <IconFoldeR />
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-actif-title-sm'>
  <ViewText />
  <IconFoldeR />
 </div>
);
export const ViewText = () => (
 <div className='wrp-actif-title-text'>
  <h1>Rapport global des actif echanger.</h1>
  <h2>Activit√©s</h2>
 </div>
);
export const IconFoldeR = () => {
 return (
  <div style={{ display: 'flex', gap: '1em' }}>
   <IconPrint />

   <Link style={{ textDecoration: 'none', color: 'black' }} to='/authorization'>
    <FcDocument size={'1.5em'} />
   </Link>

  </div>
 );
};
